import React from 'react';
import SwContext from '../swContex';

function Filtros() {
  return (
    <SwContext.Consumer>
      { ({
        filterByNumericValues,
      }) => (
        filterByNumericValues.map((filtro, index) => (
          <div key={ index }>
            { filtro.column }
            {' '}
            { filtro.comparison }
            {' '}
            { filtro.value }
          </div>
        )))}
    </SwContext.Consumer>
  );
}

export default Filtros;
